import React from "react";
import "./Header.css"; // Import the CSS for the Header component


const Header = () => {
  return (
    <header style={{ backgroundColor: "#4CAF50", color: "white", padding: "10px", textAlign: "center" }}>
      <h1>Alberto Portfolio</h1>
      <nav>
        <a href="/" style={{ margin: "0 15px", color: "white", textDecoration: "none" }}>Home</a>
        <a href="/blog" style={{ margin: "0 15px", color: "white", textDecoration: "none" }}>Blog</a>
        <a href="/news" style={{ margin: "0 15px", color: "white", textDecoration: "none" }}>News</a>
        <a href="/projects" style={{ margin: "0 15px", color: "white", textDecoration: "none" }}>Projects</a>
        <a href="/about" style={{ margin: "0 15px", color: "white", textDecoration: "none" }}>About Me</a>
        <div style={{ display: "inline-block", float: "right" }}>
          <a href="/login" style={{ margin: "0 15px", color: "white", textDecoration: "none" }}>Login</a>
          <a href="/register" style={{ margin: "0 15px", color: "white", textDecoration: "none" }}>Register</a>
        </div>
      </nav>
    </header>
  );
};

export default Header;
